import time
import cv2
import math
COLORS = {"0": (0, 0, 255), "1": (0, 255, 255), "2": (0, 255, 0), "3": (255, 255, 0), "4": (255, 0, 0), "5": (255, 0, 255)}

robots = []
data = []
paths = {}
dump.sort(key=lambda x: x[0])
for i in range(len(dump)):
    paths[dump[i][0]] = dump[i]
#robot [0:id, 1:(recentcord), 2: color 3: number 4: paths]

class Robot:
    def __init__(self, id, startcord, color, number, startpath):
        self.id = id
        self.cord = startcord
        self.color = color
        self.number = number
        self.pathid = startpath

frame_number = 450
id = 0
while frame_number < 800:
    field = cv2.imread("/Users/colinhaine/Desktop/yolo-env/comptracker/top-down.png")
    for i in paths: # i is a key
        if paths[i][1] == frame_number:
            # --- add to an existing robot ---
            cord = paths[i][4][min(paths[i][4])]
            print(cord)

            closest = 200
            bestrobot = None
            for robot in robots: 
                if not robot.pathid:
                    if math.dist(robot.cord, cord) < closest:
                        bestrobot = robot
            if bestrobot:
                print(f"found a new host for path {i} | robot {bestrobot.id}")
                robot.cord = cord
                robot.pathid = i
            # - create a new robot
            elif len(robots) < 6:
                robots.append(Robot(id, cord, paths[i][2], 1.0, i))
            #id, current location, color, confidence, following this path
            else:
                print(f'no robot found for {i}')
            id += 1

    for robot in robots: #update locations
        if robot.pathid:
            cords = dump[robot.pathid][4]
            if len(cords) > 1:  
                sorted_frames = sorted(cords.keys()) 
                for i in range(len(sorted_frames) - 1):
                    frame1, frame2 = sorted_frames[i], sorted_frames[i + 1]
                    cv2.line(field, cords[frame1], cords[frame2], COLORS[str(robot.id)], 2)
            if frame_number in cords:
                robot.cord = cords[frame_number]
                cv2.circle(field, robot.cord, 5, COLORS[str(robot.id)], -1)
                cv2.putText(field, f"{robot.id}:{robot.pathid}", robot.cord, 0, 1, (0, 0, 0), 3)
            elif frame_number > max(cords):
                robot.pathid = None #reached the end of a path
                print('out!')
        else:
            cv2.circle(field, robot.cord, 5, COLORS[str(robot.id)], -1)
            cv2.putText(field, f"{robot.id}:{robot.pathid}", robot.cord, 0, 1, (0, 0, 0), 3)
    
    cv2.circle(field, (200, 200), 150, (0, 0, 0), 1)
    cv2.imshow('paths', field)
    if cv2.waitKey(1) == 27:
        break
    data.append(robots)
    time.sleep(0.033)
    frame_number +=1
